import path from 'path';

export default async function(page, fileUrl, screenshotsDir) {
  const screenshots = [];
  try {
    // Navigate to the HTML file
    await page.goto(fileUrl);
    await page.waitForLoadState('networkidle');

    // Take initial screenshot
    await page.screenshot({ path: path.join(screenshotsDir, 'step_1_initial_page.png') });
    screenshots.push(path.join(screenshotsDir, 'step_1_initial_page.png'));

    // Find and click the "Electronics" category link.
    // There are multiple links with the text "Electronics".
    // A robust approach is to target a more specific element, like the category card,
    // or use a more specific text like "Shop electronics".
    // We will use the link with "Shop electronics" as it is unique and clear in its intent.
    const electronicsLink = page.getByRole('link', { name: 'Shop electronics' });

    // An alternative, also robust selector would be targeting the category card div:
    // const electronicsLink = page.locator('div.category-card:has-text("Electronics")');

    await electronicsLink.waitFor({ state: 'visible' });

    // Click the link to navigate to the electronics category
    await electronicsLink.click();

    // Take a screenshot after the click
    await page.screenshot({ path: path.join(screenshotsDir, 'step_2_after_click.png') });
    screenshots.push(path.join(screenshotsDir, 'step_2_after_click.png'));

    // In a real application, we would wait for navigation or new content to load.
    // Since this is a static file, we'll just confirm the click happened.
    const clickedElementText = await electronicsLink.textContent();

    return {
      success: true,
      action: "Navigated to the Electronics category by clicking the 'Shop electronics' link.",
      extractedData: {
        clickedElement: clickedElementText.trim()
      },
      screenshots,
      error: null
    };
  } catch (error) {
    // In case of an error, take a final screenshot for debugging
    await page.screenshot({ path: path.join(screenshotsDir, 'error.png') });
    screenshots.push(path.join(screenshotsDir, 'error.png'));

    return {
      success: false,
      action: "Failed to navigate to the Electronics category.",
      extractedData: {},
      screenshots,
      error: error.message
    };
  }
}
